// Navbar.js
import React from "react";
import logo from './../Assest/img/logo.png';

const Navbar = () => {
    return (
        <div className="frame">
            <div className="overlap-group-wrapper">
                <div className="overlap-group">
                    <img className="image" alt="Image" src={logo} />
                    <div className="text-wrapper">blood care Nexus</div>
                    <div className="home">&nbsp;&nbsp;&nbsp;&nbsp; Home</div>
                    <div className="text-wrapper-2">donor</div>
                    <div className="text-wrapper-3">Events</div>
                    <div className="text-wrapper-4">Blog</div>
                    <div className="text-wrapper-5"> recipient</div>
                    <div className="text-wrapper-6">Contact us</div>
                    <div className="text-wrapper-7">Bank</div>
                </div>
            </div>
        </div>
    );
};

export default Navbar;
